    .img2 {
      opacity: 0;
    }
.photo {
	opacity:0;
}
.photodiv1:hover img.photo2 {
	opacity:0;
	transition: all 0.3s ease;
}
.photodiv1:hover img.photo {
	opacity:1;
	transition: all 2s ease;
	transform: scale(1.3);
}
    .animate:hover img.img2 {
      opacity: 1;
      transition: all 2s ease;
      transform: scale(1.3);
    }

    .animate:hover img.img1 {
      opacity: 0;
      transition: all 0.3s ease;
	  

    }

	opacity:0;

}
